frontApp.controller("CategoryProductController",["$scope","$http","$window","CategoryProduct",function(n,t,i,r){n.categoriesTrongNuoc=[];n.categoriesQuocTe=[];t.get("/API/CategoryProductsAPI/").success(function(t){var i=r.getallCategory(t);angular.forEach(i,function(t){t.idCategoryParent==34&&n.categoriesTrongNuoc.push(t)});angular.forEach(i,function(t){t.idCategoryParent==35&&n.categoriesQuocTe.push(t)})})}]);